Enable Einstein Bots in a Scratch Org

You can quickly enable Einstein Bots in a scratch org using Salesforce DX.

REQUIRED EDITIONS AND USER PERMISSIONS
Einstein Bots is available in Enterprise, Performance, Unlimited, and Developer Editions.
To build and manage Einstein Bots: 
Customize Application
OR
Modify Metadata
OR
Manage Bots

To enable Einstein Bots in a scratch org, add this code to your definition file:
{
    "orgName": "AcmeCorp",
    "edition": "Developer",
    "features": ["ServiceCloud", "Chatbot"],
    "hasSampleData": "false",
    "settings": {
     "liveAgentSettings": {
       "enableLiveAgent": true
      },
      "botSettings": {
        "enableBots": true
      }
    }
}
